IF NOT EXISTS(SELECT * FROM sys.databases WHERE name = 'GameShopDb')
BEGIN
	CREATE DATABASE [GameShopDb];
END
GO

USE [GameShopDb];
GO

IF NOT EXISTS(SELECT * FROM sys.tables WHERE name = 'Games')
BEGIN
	CREATE TABLE Games(
		[Id] INT IDENTITY(1,1) NOT NULL,
		[Title] NVARCHAR(50) NULL,
		[Description] NVARCHAR(MAX) NULL,
		[Platform] NVARCHAR(10) NULL,
		[Price] DECIMAL(8,2) NULL,
		[Publisher] NVARCHAR(50) NULL,
		[ReleaseDate] DATETIME2 NULL,
		[ImagePath] NVARCHAR(MAX) NULL,
		[TrailerPath] NVARCHAR(MAX) NULL,
		[CreatedBy] NVARCHAR(50) NULL,
		[CreateTime] DATETIME2 NULL,
		[LastEditTime] DATETIME2 NULL,

		CONSTRAINT [PK_Games] PRIMARY KEY ([Id])
	);
END
GO

IF NOT EXISTS(SELECT * FROM sys.tables WHERE name = 'Reviews')
BEGIN
	CREATE TABLE Reviews(
		[Id] INT IDENTITY(1,1) NOT NULL,
		[Title] NVARCHAR(50) NULL,
		[Content] NVARCHAR(MAX) NULL,
		[GameId] INT NULL,
		[CreatedBy] NVARCHAR(50) NULL,
		[CreateTime] DATETIME2 NULL,
		[LastEditTime] DATETIME2 NULL,

		CONSTRAINT [PK_Reviews] PRIMARY KEY ([Id]),
		CONSTRAINT [FK_Reviews_Games_GameId] FOREIGN KEY ([GameId]) REFERENCES [Games] ([Id]) ON DELETE CASCADE
	);
END
GO

IF NOT EXISTS(SELECT * FROM sys.tables WHERE name = 'Orders')
BEGIN
	CREATE TABLE Orders(
		[Id] INT IDENTITY(1,1) NOT NULL,
		[OrderNumber] NVARCHAR(50) NULL,
		[Amount] DECIMAL(8,2) NULL,
		[NumberOfGames] INT NULL,
		[CreatedBy] NVARCHAR(50) NULL,
		[CreateTime] DATETIME2 NULL,
		[LastEditTime] DATETIME2 NULL,

		CONSTRAINT [PK_Orders] PRIMARY KEY ([Id])
	);
END
GO

IF NOT EXISTS(SELECT * FROM sys.tables WHERE name = 'GameOrders')
BEGIN
	CREATE TABLE GameOrders(
		[Id] INT IDENTITY(1,1) NOT NULL,
		[HasBeenReviewed] BIT NULL DEFAULT 0,
		[OrderNumber] NVARCHAR(50) NULL,
		[GameId] INT NULL,
		[OrderId] INT NULL,
		[CreatedBy] NVARCHAR(50) NULL,
		[CreateTime] DATETIME2 NULL,
		[LastEditTime] DATETIME2 NULL,

		CONSTRAINT [PK_GameOrders] PRIMARY KEY ([Id]),
		CONSTRAINT [FK_GameOrders_Games_GameId] FOREIGN KEY ([GameId]) REFERENCES [Games] ([Id]) ON DELETE CASCADE,
		CONSTRAINT [FK_GameOrders_Orders_OrdersId] FOREIGN KEY ([OrderId]) REFERENCES [Orders] ([Id]) ON DELETE CASCADE
	);
END
GO

CREATE INDEX [IX_Reviews_GameId] ON [Reviews] ([GameId]);
GO

CREATE INDEX [IX_GameOrders_GameId] ON [GameOrders] ([GameId]);
GO

CREATE INDEX [IX_GameOrders_OrderId] ON [GameOrders] ([OrderId]);
GO



